def has_cycle(graph):
    visited = set()
    rec_stack = set()

    for node in graph:
        if node not in visited:
            if has_cycle_util(node, graph, visited, rec_stack):
                return True

    return False

def has_cycle_util(node, graph, visited, rec_stack):
    visited.add(node)
    rec_stack.add(node)

    for neighbor in graph[node]:
        if neighbor not in visited:
            if has_cycle_util(neighbor, graph, visited, rec_stack):
                return True
        elif neighbor in rec_stack:
            return True

    rec_stack.remove(node)
    return False
